import React from 'react'

function MovieCard(props) {
    return (
        <div className="col mb-2">
            <div className="card bg-dark w-100 h-100" >
                <img src={props.movie.posterUrl} className="card-img-top" alt="..." />
                <div className="card-bodyd-flex align-item">
                    <h5 className="card-title text-wrap text-center" style={{fontSize:"17px"}}>{props.movie.title}</h5>
                </div>
                <div className="card-footer" style={{height:"45px"}}>
                    <small className="text-muted"></small>
                </div>
            </div>
        </div>
    )
};
export default MovieCard;
